import axios from 'axios';

const todoListArr = axios.get('http://localhost:4000/todos/').then(res => {
    console.log(res.data);
})

const initState = {
    todoList: [],
}

todoListArr.then()

const todoList = (state = initState, action) => {
    switch(action.type) {
        default:
            return state;
    }
}

export default todoList;
